import React, { ReactElement } from "react";
import { IRootObject, Portfolio } from '../interfaces';
import BuyForm from "./BuyForm";

interface StockResultProps {
    JSON: JSON | string
    portfolio: Portfolio
}

function StockResultDisplay(props: React.PropsWithChildren<StockResultProps>):ReactElement {

    function stringToJSONObject(props: StockResultProps) {
        if (typeof props.JSON != 'string') {
            const JSON = props.JSON as unknown as IRootObject
            return JSON
        }
    }
    const stockJSON: IRootObject | null = stringToJSONObject(props) ?? null
    if (stockJSON) {
        return (
            <div id="StockResultDisplay">
                <table>
                    <thead>
                        <tr><td>{stockJSON.companyName}: ${stockJSON.symbol}</td></tr>
                    </thead>
                    <tbody>
                        <tr><td>Latest Price:</td><td> {stockJSON.latestPrice}</td></tr>
                        <tr><td>52 Week High:</td><td> {stockJSON.week52High}</td></tr>
                        <tr><td>52 Week Low:</td><td> {stockJSON.week52Low}</td></tr>
                        <tr><td>P/E Ratio:</td><td> {stockJSON.peRatio}</td></tr>
                        <tr><td>Market Cap:</td><td> {stockJSON.marketCap}</td></tr>

                    </tbody>
                </table>
                <BuyForm portfolio={props.portfolio} JSON={stockJSON}/>
        </div>
        )
    } else {
        return (
            <div>
                <p>{props.JSON}</p>
            </div>
        )
    }
}


export default StockResultDisplay;
